import { useEffect } from "react";
import { Header } from "./Header.js";

import { Main } from "./Main.js";

export default function App() {
  useEffect(function () {
    fetch("http://localhost:8000/questions")
      .then((res) => res.json())
      .then((data) => console.log(data))
      .catch((err) => console.log("err"));
  });

  return (
    <div>
      <Header />

      <Main>
        <p>2/15</p>
        <p>Questions?</p>
      </Main>
    </div>
  );
}
